package com.enonic.autotests.testdata.cm;


/**
 * This class is representation of Address from Mixin-content.
 *
 */
public class AdressXml
{
	private String street;
	private String postalCode;
	private String postalPlace;
	
	public String getStreet()
	{
		return street;
	}

	public void setStreet(String street)
	{
		this.street = street;
	}

	public String getPostalCode()
	{
		return postalCode;
	}

	public void setPostalCode(String postalCode)
	{
		this.postalCode = postalCode;
	}

	public String getPostalPlace()
	{
		return postalPlace;
	}

	public void setPostalPlace(String postalPlace)
	{
		this.postalPlace = postalPlace;
	}

	
}
